  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rocky
  Mountain Arsenal National Wildlife Refuge  outlines Refuge accomplishments during
  the 1994 fiscal year. The report begins with a summary of the refuge's historical
  management, U.S. Fish and Wildlife Service involvement, and refuge purpose.  It
  contains annual summaries for Task 1 wildlife health and management, Task 2 habitat
  mitigation and enhancement, Task 3 activities coordination, Task 4 planning and
  public participation and task 5 engineering and administrative support.   Items
  of interest are provided at the end of the report, as well as detailed appendixes
  on Fish and Wildlife Cooperative Unit projects and projects with Colorado Division
  of Wildlife.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
